subSubSection.paragraph:
Description: Male: 10 mm long, 1.0 mm wide. Oval eyepatch with 22 ocelli. Color pattern as described above in Diagnosis. Second legs (
Fig. 5
) with gonapophyses shorter than telopods, apically hooked, densely setose, telopods with six podomeres, reduced in size. Third legs ( Figs. 5, 6 ) with large, blocky sternum, coxae with anteriorly projecting, flattened lobe more massive than telopods, body of coxa extends beyond coxa/trochanter articulation to setose tip; coxal lobe densely setose anteriorly, glabrous posteriorly but with subapical group of long, decurved setae; lobe appears only lightly sclerotized mesally. Legs 4 and 5 normal. Coxae 6 somewhat enlarged. Seventh legs ( Figs. 4, 7 ) with enlarged, elaborately lobed coxae; posterior basal lobe lightly sclerotized, lateral apical process with pore near tip, mesoapical lobe blunt, curved.

Gonopods in lateral view (
Fig. 3
) with single seta posterior on sternal plate, lateral lamella apically bifurcate, with basal setal group. Angiocoxite with strongly projecting lateral shelf, anterior row of four long setae; terminus complex but with prominent subdeltoid apical process densely set with short cuticular fimbriae. In mesal view (
Fig. 2
), mesal lamella bifurcate but distal bifurcation much broader than proximal, colpocoxite with membranous basal region, colpocoxite lamella typical of genus, sheathing double-branched flagellocoxite. Angiocoxite bearing two mesal subapical branches, anteriormost knoblike, posteriormost curved, itself two-branched.

Female: 10 mm long, 1.1 mm wide. Oval eyepatch with 22 ocelli, color entirely dark purplish brown with slightly lighter mottling. Legpair 3 with elongate coxae; sternum produced laterally, with triangular median process. Cyphopod receptacle U-shaped, with two processes, the lateral broadly flattened laterally, the mesal finger-like; both setose on posterior surface (
Fig. 10
).
